!! August 1st. A Nice, Quiet And Cosy Bedroom Only Minutes From UVic. !!
ESL or International students are welcome. If you are at home-stay right now and want to be more independent and do you own cooking, well this is the place you want to be.!!!!!
Looking for an easy going (f) roommate, clean, tidy, reliable, honest and trustworthy student or working person. Please, non smoker, no drugs and no pets. The room is cosy, bright and very quiet with a wonderful view in a beautiful large over 3000 square foot home in a nice, quiet and safe neighborhood. It is furnished with a twin size bed, desk, dresser, bedside table, door mirror, chair, bookcase, desk lamp, bedside table lamp and a build-in closet.
Supplied are pillow, blanket and bed cover. Shared are the 3 decks, large kitchen including dishes, cutlery, pots and pans, living & dining room, girls only bathroom, additional washrooms, washer and dryer.
Only 7 Minutes to the University of Victoria and close to University Heights Shopping Center, 4 Supermarkets, Banks, Cinemas, Restaurants etc., Buses #12, 26, 27, 28, 29 & 39, Bus #12, 29 and 39 go direct to UVic. and the Bus #27 & 28 go direct to down town which only takes 20-25 minutes.
Monthly rent $460.00 for the (110 sq ft) bedroom plus $70.00 for all Utilities which includes High Speed Wireless Internet, Water, Heat and Electricity.
Long term only!
For more information or to make a viewing appointment please contact us by email and tell us about yourself and where you can be reached at, please include your phone number and we will get back to you.
